import React from "react";
import Footer from "./components/Footer";
import Header from "./components/Header";
import Meme from "./components/Header";
import Search from "./components/Header";

function App() {
  return (
    <>
      <Header />
      <Search />
      <Meme />
      <Footer />
    </>
  );
}

export default App;
